import LoginForm from '../components/LoginForm';

const LoginContainer = () => {
  return (
    <div dropzone="true" onDrop={() => console.log("Dropped")} style={{backgroundColor: "blue"}}>
      <LoginForm />
    </div>
  );
};

export default LoginContainer;
